    int toHash(const std::vector<core::PieceType> &pieces, int n) {
        assert(n == 5 || n == 6);
        int hash = pieces[0];
        for (int i = 1; i < n; ++i) {
            hash *= 7;
            hash += pieces[i];
        }
        return hash;
    }

    bool canTake2LinePC(std::vector<core::PieceType> &pieces) {
        if (pieces.size() == 5) {
            int hash = toHash(pieces, 5);
            auto it = hashes5.find(hash);
            return it != hashes5.cend();
        } else if (5 < pieces.size()) {
            int hash = toHash(pieces, 6);
            auto it = hashes6.find(hash);
            return it != hashes6.cend();
        }

        throw std::runtime_error("Only supports 5 pieces or more");
    }
